import React from 'react';
import { Container, Input, Title } from './index.styles';
function InputText({ title, input }) {
  return (
    <Container>
      <Title>{title}</Title>
      <Input>{input}</Input>
    </Container>
  )
}

InputText.propTypes = {
  label: PropTypes.string.isRequired,
  error: PropTypes.string
};

export default InputText;
